import React, { useContext } from 'react'
import { CartContext } from '../../context/context';

const Cart = () => {
  const setItem = JSON.parse(useContext(CartContext));
  console.log(setItem);
  return (

    <img className="py-5" src={require('./carrito.jpg')} alt="No hay tal carrito" />
  )
}

export default Cart;
